import React from "react";
import AgentProfiles from "./AgentProfiles";
import agent1 from "./img/agent1.jpg";
import agent3 from "./img/agent3.jpg";
import agent4 from "./img/agent4.jpg";

function AgentKevinProfile(props) {
  const card1template = {
    cardImg: house1,
    agentImg: agent1,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$5,200,000",
    bedrooms: "4",
    bathrooms: "5",
    sqft: "6,500 SqFt",
  };

  const card2template = {
    cardImg: house2,
    agentImg: agent1,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$1,800,000",
    bedrooms: "3",
    bathrooms: "4",
    sqft: "4,500 SqFt",
  };

  const card3template = {
    cardImg: house3,
    agentImg: agent1,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$2,300,000",
    bedrooms: "4",
    bathrooms: "5",
    sqft: "5,000 SqFt",
  };
  const card4template = {
    cardImg: house4,
    agentImg: agent1,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$900,000",
    bedrooms: "2",
    bathrooms: "3",
    sqft: "2,750 SqFt",
  };
  const card5template = {
    cardImg: house5,
    agentImg: agent1,
    cardTitle: "Mansion on Lorem Ave",
    address: "555 Lorem Avenue, Miami, FL 12345, USA",
    cardPrice: "$650,000",
    bedrooms: "2",
    bathrooms: "3",
    sqft: "2,300 SqFt",
  };
  return (
    <div>
      <div className="agent_kevin_profile">
        <AgentProfiles
          agentImg={agent3}
          agentName="Kevin Richmond"
          card1template={card1template}
          card2template={card2template}
          card3template={card3template}
          card4template={card4template}
          card5template={card5template}
        />
      </div>
    </div>
  );
}

export default AgentKevinProfile;
